    to all official versions of vocabulary value sets contained in the 2014 Clinical
    Quality Measures (CQMs). Each value set consists of the numerical values (codes)
    and human-readable names (terms), drawn from standard vocabularies such as SNOMED
    CTu00ae , RxNorm, LOINC and ICD-10-CM, which are used to define clinical concepts
    used in clinical quality measures (e.g., patients with diabetes, clinical visit).</p>n",nt"license_title":
